{{Infobox figure skater |name= Philip Dulebohn |image= Scott_dulebohn.jpg |caption= Dulebohn competes with former partner [[Tiffany Scott]] in 2004. |country= [[United States]] |birth_date= {{birth date and age|1973|9|13}} |birth_place= [[Silver Spring, Maryland|Silver Spring]], [[Maryland]], [[United States]] |residence= |height= |partner= |formerpartner= [[Tiffany Scott]] |coach= |formercoach= |choreographer= |formerchoreographer= |skating club= |retired= |medaltemplates= <!-- see [[Template:MedalRelatedTemplates]] --> {{MedalCountry| [[United States]]}} {{MedalSport | Pairs' [[Figure skating]]}} {{MedalCompetition|[[Four Continents Figure Skating Championships|Four Continents Championships]]}} {{MedalBronze| [[2000 Four Continents Figure Skating Championships|2000 Osaka]]|Pairs}} }} '''Philip Dulebohn''' (born September 13, 1973 in [[Silver Spring, Maryland]]) is an [[United States|American]] [[pair skater]]. He competed in pairs with partner [[Tiffany Scott]], and the duo won the gold medal at the 2003 [[U.S. Figure Skating Championships]]. He and Scott ended their partnership in 2005, and now Dulebohn coaches Scott and her new partner, [[Rusty Fein]].
His brother, [[Paul Dulebohn]], was also a competitive skater.
